import Vue from 'vue';
import Router from 'vue-router';
import Etudiant from '@/components/Etudiant.vue';
import Prof from '@/components/Prof.vue';
import WelcomePage from '@/components/HelloWorld.vue';

Vue.use(Router);

export default new Router({
    routes: [
        {
            path: '/',
            name: 'WelcomePage',
            component: WelcomePage,
        },
        {
            path: '/etudiant',
            name: 'Etudiant',
            component: Etudiant,
        },
        {
            path: '/prof',
            name: 'Prof',
            component: Prof,
        },
    ],
});
